do a requisição Post for feita no método create do ClienteController\n    Entao receber ResponseEntity com HTTP 201 do ClienteController\n    E com ClienteDtoResponse no body, com id e nome \"Jim Highsmith\" e email \"jim@email.com\" e login \"highsmith\" e senha \"high123\" e numeroCartaoFidelidade \"1234-6666-004\"\n    E o Cliente cadastrado no banco de dados possui nome \"Jim Highsmith\" e email \"jim@email.com\" e login \"highsmith\" e senha \"high123\" e numeroCartaoFidelidade \"1234-6666-004\"\n\n  Cenario: Post para criar Cliente e Endereço, com sucesso, pelo ClienteController\n    Dado um ClienteDtoRequest e EnderecoDtoRequest, com nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e numeroCartaoFidelidade \"1234-6666-013\" e com cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\"\n    Quando a requisição Post for feita no método create do ClienteController\n    Entao receber ResponseEntity com HTTP 201 do ClienteController\n    E com ClienteDtoResponse no body, com id e nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e numeroCartaoFidelidade \"1234-6666-013\"\n    E com EnderecoDtoResponse no body, com id e cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\"\n    E o Cliente cadastrado no banco de dados possui nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e numeroCartaoFidelidade \"1234-6666-013\"\n    E um Endereço salvo no database, com cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\"\n\n  Cenario: Post para criar Cliente, com erro por email não único, pelo ClienteController\n    Dado um ClienteDtoRequest, com nome \"Alistair Cockburnn\" e email \"mike@email.com\" e login \"alistair\" e senha \"12345\" e numeroCartaoFidelidade \"1234-6666-987\"\n    Quando a requisição Post for feita no método create do ClienteController\n    Entao receber ResponseEntity com HTTP 409 do },{"source":{"uri":"classpath:features\/proprietario.feature","data":"# language: pt\nFuncionalidade: testar operações Create\/POST, Read\/GET, Update\/PUT e Delete\/DELETE\n  Como Usuário dessa API Rest, desejo cadastrar, consultar, atualizar e deletar Proprietário\n  Dessa forma, ter respostas padrão de sucesso ou de erro\n  Para saber se meu sistema foi capaz de executar um CRUD de Proprietário\n\n  Contexto:\n    Dado ambiente de teste ativado para Proprietário de Challenge_User\n    Dado cadastros de Proprietários disponíveis no banco de dados\n      |       nome        |          email         |    login    |     senha     |      cep     |  logradouro  |   numero   |        descricao        |\n      |  Martin Fowler    |   fowler2@email.com    |   mfowler   |   fowler123   |      null    |      null    |    null    |      gerente geral      |\n      |     Kent Beck     |     beck2@proton.me    |     kbeck   |     beck123   |      null    |      null    |    null    |       atendente         |\n      |  Jeff Sutherland  |     jeff2@gmail.com    |   jsuther   |   suther234   |      null    |      null    |    null    |       investidor        |\n      |    James Clear    |  jamesclear@gmail.com  |    jamesc   |    james12    |   78098-179  |     Rua L    |     300    |        contador         |\n      |    Ron Jeffries   |     ronj@gmail.com     |   jeffries  |   jeffries12  |   78098-800  |     Rua H    |     709    |          teste2         |\n      |     Eric Evans    |     eric@yahoo.com     |     evans   |    evans123   |   75666-908  |     Rua O    |     110    |          teste3         |\n\n  Cenario: Post para criar Proprietário, com sucesso, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"Alistair Cockburn\" e email \"cock@email.com\" e login \"cockburn\" e senha \"cock12\" e descricao \"advogado\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 201    einstein@proton.me  |   einstein   |  einstein123  |     8001-5555-011        |\n    Dado cadastros de Proprietários disponíveis no banco de dados para RestauranteController\n      |       nome        |         email         |    login     |    senha      |  descricao  |\n      |  Galileu Galilei  |    galilei@yahoo.com  |    galilei   |   galilei123  |   Teste1    |\n      |     Niels Bohr    |      bohr@yahoo.com   |     bohr     |    bohr123    |   Teste2    |\n    Dado cadastros de Restaurantes disponíveis no banco de dados\n      |         nome        |\n      |    Casa do Porco    |\n      |      Coco Bambu     |\n      |        Fasano       |\n      |        D.O.M        |\n\n  Cenario: Post para criar Restaurante, com sucesso, pelo RestauranteController\n    Dado um RestauranteDtoRequest, com nome \"Arturito\"\n    Quando a requisição Post for feita no método create do RestauranteController\n    Entao receber ResponseEntity com HTTP 201 do RestauranteController\n    E com RestauranteDtoResponse no body, com id e nome \"Arturito\"\n    E o Restaurante cadastrado no banco de dados possui nome \"Arturito\"\n\n  Cenario: Post para criar Restaurante, com erro por nome vazio, pelo RestauranteController\n    Dado um RestauranteDtoRequest, com nome \"   \"\n    Quando a requisição Post for feita no método create do RestauranteController\n    Entao receber ResponseEntity com HTTP 400 do RestauranteController\n\n\n  Cenario: Put para atualizar Restaurante, com sucesso, pelo RestauranteController\n    Dado um identificador ID de um Restaurante existente, com nome \"Fasano\"\n    E um RestauranteDtoRequest, com nome \"Fasano Atualizado\"\n    Quando uma requisição Put for feita no método update do RestauranteController\n    Entao receber ResponseEntity com HTTP 200 do RestauranteController\n    E com RestauranteDtoResponse no body, com id e nome \"Fasano Atualizado\"\n    E o Restaurante cadastrado no banco de dados possui nome \"Fasano Atualizado\"\n\n  Cenario: Put para atualizar Restaurante, com erro not found, pelo RestauranteController\n    Dado um identificador ID de um Restaurante inexistente\n    E um RestauranteDtoRequest, com nome \"Arturito\"\n    Quando uma requisição Put for feita no método update do RestauranteController\n    Entao receber ResponseEntity com HTTP 404 do RestauranteController\n\n  Cenario: Put para atualizar Restaurante, com erro por nome vazio, pelo RestauranteController\n    Dado um identificador ID de um Restaurante existente, com nome \"D.O.M\"\n    E um RestauranteDtoRequest, com nome \"   \"\n    Quando uma requisição Put for feita no método update do RestauranteController\n    Entao receber ResponseEntity com HTTP 400 do RestauranteController\n    E o Restaurante cadastrado no database possui nome \"D.O.M\"\n\n\n  Cenario: Get para consultar Restaurante, com sucesso, pelo RestauranteController\n    Dado um identificador ID de um Restaurante existente, com nome \"Casa do Porco\"\n    Quando uma requisição Get for feita no método findById do RestauranteController\n    Entao receber ResponseEntity com HTTP 200 do RestauranteController\n    E com RestauranteDtoResponse no body, com id e nome \"Casa do Porco\"\n\n  Cenario: Get para consultar Restaurante, com erro not found, pelo RestauranteController\n    Dado um identificador ID de um Restaurante inexistente\n    Quando uma requisição Get for feita no método findById do RestauranteController\n    Entao receber ResponseEntity com HTTP 404 do RestauranteController\n\n\n  Cenario: Delete para apagar Restaurante, com sucesso, pelo RestauranteController\n    Dado um identificador ID de um Restaurante existente, com nome \"Coco Bambu\"\n    Quando uma requisição Delete for feita no método deleteById do RestauranteController\n    Entao receber ResponseEntity com HTTP 204 do RestauranteController\n    E o Restaurante foi apagado do banco de dados pelo RestauranteController\n\n  Cenario: Delete para apagar Restaurante, com erro not found, pelo RestauranteController\n    Dado um identificador ID de um Restaurante inexistente\n    Quando uma requisição Delete for feita no método deleteById do RestauranteController\n    Entao receber ResponseEntity com HTTP 404 do RestauranteController\n\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features\/restaurante.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"pt","keyword":"Funcionalidade","name":"testar operações Create\/POST, Read\/GET, Update\/PUT e Delete\/DELETE","description":"  Como Usuário dessa API Rest, desejo cadastrar, consultar, atualizar e deletar Restaurante\n  Dessa forma, ter respostas padrão de sucesso ou de erro\n  Para saber se meu sistema foi capaz de executar um CRUD de Restaurante","children":[{"background":{"location":{"line":7,"column":3},"keyword":"Contexto","name":"","description":"","steps":[{"location":{"line":8,"column":5},"keyword":"Dado ","keywordType":"Context","text":"ambiente de teste ativado para Restaurante de Challenge_User","id":"b63d1b6d-88fd-4afc-9cc7-aa7ee573263a"},{"location":{"line":9,"column":5},"keyword":"Dado ","keywordType":"Context","text":"cadastros de Clientes disponíveis no banco de dados para RestauranteController","dataTable":{"location":{"line":10,"column":7},"rows":[{"location":{"line":10,"column":7},"cells":[{"location":{"line":10,"column":15},"value":"nome"},{"location":{"line":10,"column":37},"value":"email"},{"location":{"line":10,"column":56},"value":"login"},{"location":{"line":10,"column":71},"value":"senha"},{"location":{"line":10,"column":85},"value":"numeroCartaoFidelidade"}],"id":"979d4945-bef8-4d9f-8a45-ede2019fac51"},{"location":{"line":11,"column":7},"cells":[{"location":{"line":11,"column":11},"value":"Isaac Newton"},{"location":{"line":11,"column":32},"value":"newton@email.com"},{"location":{"line":11,"column":56},"value":"newton"},{"location":{"line":11,"column":70},"value":"newton123"},{"location":{"line":11,"column":88},"value":"8000-
